import React, { useState, useEffect } from "react";
import { Box, Stack, Typography } from "@mui/material";
const Feed = () => {
  return (
    <Stack sx={{ flexDirection: { sm: "column", md: "row" } }}>
      <Box sx={{ height: { sm: "auto", md: "10vh" } }}></Box>
    </Stack>
  );
};

export default Feed;
